<script>
    function getQueryVariable(variable) {
	    var query = window.location.search.substring(1);
	    var vars = query.split('&');
	    for (var i = 0; i < vars.length; i++) {
	        var pair = vars[i].split('=');
	        if (decodeURIComponent(pair[0]) == variable) {
	            return decodeURIComponent(pair[1]);
	        }
	    }
	    return 'NULL'
	}

	var session = getQueryVariable('session');
	var mkturkid = getQueryVariable('mkturk_id');

	$("#mkid").text(mkturkid);
	$("#session").text(session);

    var session = getQueryVariable('session');
    var mkturkid = getQueryVariable('mkturk_id');
    var task = getQueryVariable('task');

	function toCSV(text){
		tmp=text.split(/\r?\n/);
		out="";
		for(i=0;i<tmp.length-1;i++){
			tmp2=tmp[i].split(/\s+/);
			for(j=0;j<tmp2.length;j++){
				// multiplies the 3rd and 4th column by .001 to turn into seconds
				if (j == 3 || j == 4){
					out=out+""+(tmp2[j] * 0.001) +","
				}
				else{
					out=out+""+tmp2[j]+","
				}
				
			}
			out=out+"\n"
		}return out
	}
    function getQueryVariable(variable) {
        var query = window.location.search.substring(1);
        var vars = query.split('&');
        for (var i = 0; i < vars.length; i++) {
            var pair = vars[i].split('=');
            if (decodeURIComponent(pair[0]) == variable) {
                return decodeURIComponent(pair[1]);
            }
        }
        return 'NULL'
    }


    function postData(data, session, mkturkid, task){
        $.ajax({
            type: 'POST',
            url: 'saveTask?session=' + session + '&mkturk_id=' + mkturkid + '&task=' + task,
            data: JSON.stringify({content : data}), // or JSON.stringify ({name: 'jonas'}),
            success: function(data) { alert('data: ' + data); },
            contentType: "application/json",
            dataType: 'json'
        });
    }
